import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonLabel, IonItem, IonCheckbox } from '@ionic/react';
import './Tab1.css';

const Tab1: React.FC = () => {
  return (
    <IonPage>
      <IonContent class="page-content">
        <IonContent class="header-content">
          <IonHeader class="header-container">
            <IonToolbar>
              <IonTitle size="large">Track your daily chores here!</IonTitle>
            </IonToolbar>
          </IonHeader>
        </IonContent>
        <IonContent class="body-content">
          <IonItem>
            <IonLabel class="chore-label">
              Daily chore 1
            </IonLabel>
            <IonCheckbox />
          </IonItem>
        </IonContent>
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
